import Footer from "../footer/Footer";
import {useState} from "react";
import * as Yup from "yup";
//import { Link } from 'react-router-dom'
import '../css/pay.css'
//import axios from 'axios';
//import html2canvas from 'html2canvas';
//import jsPDF from 'jspdf';


const Pay = () => {
  const [formData, setFormData] = useState({
    paymentID: "",
    paymentAmount: "",
    paymentDate:"",
    pDescription: "",
    nic:"",
    password: "",
    confirmPassword: "",
    parentName: "",
    phoneNumber: "",
  });


  const [loader, setLoader] = useState(false);

  
  



  const [errors, setErrors] = useState({});

  const validationSchema = Yup.object({
    firstName: Yup.string().required("First Name is Required"),
    parentName: Yup.string().required("Parent Name is Required"),
    email: Yup.string()
      .required("Email is Required")
      .email("Invalid email format"),
    phoneNumber: Yup.string()
      .matches(/^\d{10}$/, "Phone Number must be 10 digits")
      .required(),
    password: Yup.string()
      .required("Password is required")
      .min(8, "Password must be at least 8 characters")
      .matches(
        /[!@#$%^&*(),.?":{}|<>]/,
        "Password must contain at least one symbol"
      )
      .matches(/[0-9]/, "Password must contain at least one number")
      .matches(/[A-Z]/, "Password must contain at least one uppercase letter")
      .matches(/[a-z]/, "Password must contain at least one lowercase letter"),
    confirmPassword: Yup.string()
      .oneOf([Yup.ref("password")], "Passwords must match")
      .required("Confirm password is required"),
    age: Yup.number()
      .typeError("Age must be a number")
      .min(18, "You must be at least 18 years old")
      .max(100, "You cannot be older than 100 years")
      .required("Age is required"),
    birthDate: Yup.date().required("Date of birth is required"),
  });

  const handleSubmit = async (e) => {
    e.preventDefault();



    const nonParsed = {
      firstName: "Piyush",
      email: "piyush@example.com",
      age: "18",
      birthDate: "2024-02-12",
      nic:"200111203991",
      password: "123456Qq*",
      confirmPassword: "123456Qq*",
      parentName:"Taylor",
      phoneNumber: "1231234218",
     };

    const parsedUser = validationSchema.cast(nonParsed);

    console.log(nonParsed, parsedUser);

    try {
        await validationSchema.validate(formData, { abortEarly: false });
        //const response = await axios.post('/api/warden/register', formData);
        //console.log('Form submitted:', response.data);
        // Reset errors state
        setErrors({});
      } catch (error) {
        const newErrors = {};
        error.inner.forEach((err) => {
          newErrors[err.path] = err.message;
        });
        setErrors(newErrors);
      }
      
  };

  const handleChange = (e) => {
    const {name, value} = e.target;

    setFormData({
      ...formData,
      [name]: value,
    });
  };

 

  return (
    <div>
    <div className="container">
    <form className="form" onSubmit={handleSubmit}>
      <div>
        <label>paymentID:</label>
        <input
          type="text"
          name="paymentID"
          value={formData.paymentID}
          placeholder="Enter your paymentID"
          onChange={handleChange}
        />
        {errors.paymentID && <div className="error">{errors.paymentID}</div>}
      </div>

      <div>
        <label>paymentAmount:</label>
        <input
          type="Number"
          name="paymentAmount"
          value={formData.paymentAmount}
          placeholder="Enter your payment Amount"
          onChange={handleChange}
        />
        {errors.paymentAmount && <div className="error">{errors.paymentAmount}</div>}
      </div>

      <div>
        <label>paymentDate:</label>
        <input
          type="Date"
          name="paymentDate"
          value={formData.paymentDate}
          placeholder="Enter your paymentDate"
          onChange={handleChange}
        />
        {errors.paymentDate && <div className="error">{errors.paymentDate}</div>}
      </div>

      <div>
        <label> pDescription:</label>
        <input
          type="text"
          name="pDescription"
          value={formData.pDescription}
          placeholder="Enter your Payment Description"
          onChange={handleChange}
        />
        {errors.pDescription && <div className="error">{errors.pDescription}</div>}
      </div>

      <div>
        <label>pAddressl:</label>
        <input
          type="text"
          name="pAddressl"
          value={formData.pAddressl}
          placeholder="Enter your pAddressl "
          onChange={handleChange}
        />
        {errors.pAddressl && (
          <div className="error">{errors.pAddressl}</div>
        )}
      </div>

      <div>
        <label>pCountry:</label>
        <input
          type="text"
          name="pCountry"
          value={formData.pCountry}
          placeholder="Enter your pCountry"
          onChange={handleChange}
        />
        {errors.pCountry && <div className="error">{errors.pCountry}</div>}
      </div>

     
        
     
      
      

      
      
      <button type="submit">Submit</button>
    </form>



    </div>
    <Footer />   
   </div>
  

  );
};

export default Pay;
